import '../App.css';
import CreateRace from './CreateRace';
import AddCircuit from "./AddCircuit";
import React, { useEffect, useState } from "react";

function Home() {
  const [isLoggedIn, setIsLoggedIn] = useState(false)

        async function checkLoggedIn() {
            let restURL = "http://localhost:8081/race/rest/users/isLoggedIn";
            await fetch(restURL, {
                method: "GET",
                credentials: 'include',
                headers: {
                    mode: 'no-cors',
                    'Content-Type': 'application/json',
                }
            })
                .then(response => {
                    return response.json()
                })
                .then(data => {
                    setIsLoggedIn(data);
                })
        }
        useEffect(() => {
            checkLoggedIn();
        }, [])
        
        if(isLoggedIn){
          return (
              <div className="Home">
                  <CreateRace/>
              </div>
          );
        }
}

export default Home;
